def main():
    results = {}
    for line in ALL_LOGS.split("\n"):
        if len(line) == 0:
            continue
        m = re.fullmatch(r".*/_([a-z0-9]*)_(.*).log:all_stat=Counter\((.*)\)", line)
        which_fn, which_set, res = m.group(1), m.group(2), eval(m.group(3))
        if which_set != "frames":
            results[(which_fn, which_set)] = res
    # =====
    ALL_WSET = ["train", "dev", "test", "test1", "exemplars", "exemplars_filtered"]
    all_dataframes = []
    for which_fn in ["fn15", "fn17"]:
        all_keys = set()
        for ii, which_set in enumerate(ALL_WSET):
            one_res = results[(which_fn, which_set)]
            all_keys.update(one_res.keys())
        # --
        concat_res = {k:[] for k in sorted(all_keys)}
        for ii, which_set in enumerate(ALL_WSET):
            one_res = results[(which_fn, which_set)]
            for k in concat_res.keys():
                concat_res[k].append(one_res.get(k, 0))
        d0 = pd.DataFrame(concat_res)
        d1 = d0.transpose()
        print(d1.to_string())
        all_dataframes.append(d1)
    print("Finish")
    # --

if __name__ == '__main__':
    main()
